import React from "react";

export default function Progress({
  index,
  numQuestions,
  points,
  maxPossiblePoints,
}) {
  return (
    <header className="progress-header">
      <p>
        Question {index + 1} / {numQuestions}
      </p>

      <p>
        {points} / {maxPossiblePoints}
      </p>
    </header>
  );
}
